import React from "react";
export default class AddPrizeModal extends React.Component {


  render() {
    if(!this.props.addPrize){
          return null;
      }

    return (
      <React.Fragment>
      <div className="ap-modal">
      <div className="ap-modalmain">
      <p className="ap-text">Add Prize</p>
      <form>
      <input className="ap-input" type="text" name="name" />
        <input type="dropdown" name="name" />
      <input type="submit" value="Yes" />
      </form>
      </div>
      </div>
      </React.Fragment>
    )
  }
}
